webpackJsonp([0x68f44a804e55],{6359:function(a,e){a.exports={data:{markdownRemark:{html:'<h2>Open Data</h2>\n<p>Open data is data that is freely available and anyone can <em>access, reuse, and share</em> it.</p>\n<p>The following points are characteristic of open data:</p>\n<ul>\n<li>The data becomes usable by being available in a common understandable format.</li>\n<li>The data must be available under an open license. This allows anyone to use, redistribute and modify it.</li>\n</ul>\n<p>Open data can help governments, businesses, and individuals. It can improve services, bring socioeconomic changes, and protect the planet.</p>\n<p>One way that you can use open data is through Civic Hacking in your local code for America Brigade. </p>\n<h4>More Information:</h4>\n<!-- Please add any articles you think might be helpful to read before writing the article -->\n<ul>\n<li><a href="https://en.wikipedia.org/wiki/Open_data">Open Data Wikipedia Page</a></li>\n<li><a href="http://brigade.codeforamerica.org/brigade/">Find Your Brigade</a></li>\n</ul>',fields:{slug:"/working-in-tech/open-data/"},frontmatter:{title:"Open Data"}}},pathContext:{slug:"/working-in-tech/open-data/"}}}});
